import React,{Component} from 'react'
import './signup.css';
class Signup extends Component{

    submitData=(event)=>{
        event.preventDefault();
        // const formData = {
        //     name: event.target.elements.name.value,
        //     email: event.target.elements.email.value,
        //     password: event.target.elements.password.value
        // };
        console.log(event.target)
    }
render(){


    return(
        <div className='loginpage-container'>
           <div className='login-container'>
           <h1 className='login-heading'>Create<br></br> New Account</h1>
            <form  onClick={this.submitData} >
                <lable className='loginpage-lable' id='name'>Name</lable><br></br>
                <input className='loginpage-input' type='text'></input><br></br>
                <lable className='loginpage-lable'name='email'>Email</lable><br></br>
                <input className='loginpage-input' type='text'></input><br></br>
                <lable className='loginpage-lable'name='password'>Password</lable><br></br>
                <input className='loginpage-input' type='password'></input><br></br>
                <button className='loginpage-submitbutton' type='submit'>Submit</button><br></br>
                <lable className="signup-redirecting">We Have Account<a href='/login'>Login</a></lable>
            </form>
           </div>
        </div>
    )
}
}
export default Signup;
